import React, { useEffect, useState } from "react";
import axios from "axios";
import { motion } from "framer-motion";

function App() {
  const [places, setPlaces] = useState([]);
  const [location, setLocation] = useState("Rampally");
  const [loading, setLoading] = useState(false);
  const [selectedPlace, setSelectedPlace] = useState(null);

  useEffect(() => {
    const fetchPlaces = async () => {
      try {
        setLoading(true);
        const res = await axios.get("http://localhost:5000/api/places", {
          params: { location },
        });
        setPlaces(res.data);
        setLoading(false);
      } catch (err) {
        console.error("Failed to fetch places:", err);
        setLoading(false);
      }
    };

    fetchPlaces();
  }, [location]);

  const handleInputChange = (e) => setLocation(e.target.value);
  const handleSearch = () => location.trim() !== "" && setLocation(location);

  return (
    <div className="min-h-screen bg-gradient-to-br from-indigo-100 via-purple-100 to-pink-100 p-6">
      {/* Header */}
      <h1 className="text-4xl font-bold text-center mb-8 text-gray-800">üåé Local Explorer</h1>

      {/* Search Bar */}
      <div className="flex justify-center mb-8">
        <input
          type="text"
          value={location}
          onChange={handleInputChange}
          placeholder="Search a location (e.g., Rampally)"
          className="p-3 rounded-l-3xl w-72 md:w-96 shadow-lg border focus:outline-none"
        />
        <button
          onClick={handleSearch}
          className="bg-gradient-to-r from-purple-500 to-pink-500 text-white px-6 rounded-r-3xl hover:scale-105 transition"
        >
          Search
        </button>
      </div>

      {/* Loading */}
      {loading && (
        <div className="text-center text-gray-500">‚ú® Fetching nearby places...</div>
      )}

      {/* Places Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
        {places.map((place, index) => (
          <motion.div
            key={index}
            onClick={() => setSelectedPlace(place)}
            whileHover={{ scale: 1.05 }}
            className="bg-white rounded-2xl shadow-xl cursor-pointer overflow-hidden"
          >
            <img
              src={
                place.photos?.length
                  ? `https://maps.googleapis.com/maps/api/place/photo?maxwidth=400&photoreference=${place.photos[0].photo_reference}&key=AIzaSyB3PgI153B24mtSoJvKSjCPQyEyDQqu3K8`
                  : "https://via.placeholder.com/400x200?text=No+Image"
              }
              alt={place.name}
              className="w-full h-48 object-cover"
            />
            <div className="p-4">
              <h2 className="text-xl font-semibold text-gray-800">{place.name}</h2>
              <p className="text-gray-600 text-sm">{place.formatted_address}</p>
              {place.rating && (
                <p className="text-yellow-500 font-medium mt-1">‚≠ê {place.rating}/5</p>
              )}
            </div>
          </motion.div>
        ))}
      </div>

      {/* No Results */}
      {!loading && places.length === 0 && (
        <p className="text-center text-gray-500 mt-6">
          üòï No places found for "{location}"
        </p>
      )}

      {/* Reviews Modal */}
      {selectedPlace && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex justify-center items-center">
          <motion.div
            initial={{ scale: 0.8, opacity: 0 }}
            animate={{ scale: 1, opacity: 1 }}
            exit={{ scale: 0.8, opacity: 0 }}
            className="bg-white rounded-3xl p-6 w-11/12 md:w-2/3 max-h-[80vh] overflow-y-auto shadow-2xl"
          >
            <h2 className="text-3xl font-bold text-gray-800 mb-3">{selectedPlace.name}</h2>
            <p className="text-gray-500 mb-4">{selectedPlace.formatted_address}</p>
            <p className="text-yellow-500 font-medium mb-4">‚≠ê {selectedPlace.rating}/5</p>
            <h3 className="text-2xl font-semibold text-gray-700 mb-2">Reviews</h3>
            {selectedPlace.reviews.length ? (
              selectedPlace.reviews.map((review, idx) => (
                <div key={idx} className="border-t pt-2 mt-2">
                  <p className="font-semibold">{review.author_name}</p>
                  <p className="text-yellow-400">‚≠ê {review.rating}</p>
                  <p className="text-gray-600">{review.text}</p>
                </div>
              ))
            ) : (
              <p className="text-gray-400">No reviews available.</p>
            )}
            <button
              onClick={() => setSelectedPlace(null)}
              className="mt-6 bg-red-500 text-white px-5 py-2 rounded-full hover:bg-red-600"
            >
              Close
            </button>
          </motion.div>
        </div>
      )}
    </div>
  );
}

export default App;
